(function($){
    $.fn.extend({
        tableHTMLExport: function(options) {
            var banner = "data:image/jpeg;base64,";
            var defaults = {
                separator: ',',
                newline: '\r\n',
                ignoreColumns: '',
                ignoreRows: '',
                type:'csv',
                htmlContent: false,
                consoleLog: false,
                trimContent: true,
                quoteFields: true,
                filename: 'tableHTMLExport.csv'
            };
            var options = $.extend(defaults, options);

            function quote(text) {
                return '"' + text.replace('"', '""') + '"';
            }

            function parseString(data) {
                if(defaults.htmlContent){
                    content_data = data.html().trim();
                }else{
                    if (data.attr('type') == 'text') {
                        content_data = data.val().trim();
                    } else {
                        content_data = data.text().trim();
                    }
                }
                return content_data;
            }

            function download(filename, text) {
                var element = document.createElement('a');
                element.setAttribute('href', 'data:text/csv;charset=utf-8,' + encodeURIComponent(text));
                element.setAttribute('download', filename);

                element.style.display = 'none';
                document.body.appendChild(element);

                element.click();

                document.body.removeChild(element);
            }

            /**
             * Convierte la tabla enviada a json
             * @param el
             * @returns {{header: *, data: Array}}
             */
            function toJson(el){
                var jsonHeaderArray = [];
                $(el).find('thead').find('tr').not(options.ignoreRows).each(function() {
                    var tdData ="";
                    var jsonArrayTd = [];
                    jsonArrayTd.push("S.No");
                    $(this).find('th').not(options.ignoreColumns).each(function(index,data) {
                        if ($(this).css('display') != 'none'){
                            jsonArrayTd.push(parseString($(this)));
                        }
                    });
                    jsonHeaderArray.push(jsonArrayTd);

                });

                var jsonArray = [];
                var sno = 0;
                $(el).find('tbody').find('tr').not(options.ignoreRows).each(function() {
                    var tdData ="";
                    var jsonArrayTd = [];

                    var qty = $(this).find( ".qty_id" ).val();
                    if (qty != '' && qty > 0) {
                        sno += 1;
                        jsonArrayTd.push(sno);
                        $(this).find('td').not(options.ignoreColumns).each(function(index,data) {
                            if ($(this).css('display') != 'none'){
                                if ($(this).hasClass('quantity')) {
                                    jsonArrayTd.push(parseString($(this).find('.qty_id')));
                                } else {
                                    jsonArrayTd.push(parseString($(this)));
                                }
                            }
                        });
                        jsonArray.push(jsonArrayTd);
                    }
                });

                var orderSummary = {
                    totalItems: 0,
                    totalAmount: 0
                };

                $(el).find('tfoot').find('tr').not(options.ignoreRows).each(function() {
                    var tdData ="";
                    var jsonArrayTd = [];
                    jsonArrayTd.push("");
                    $(this).find('th').not(options.ignoreColumns).each(function(index,data) {
                        if ($(this).css('display') != 'none'){
                            jsonArrayTd.push(parseString($(this)));
                        }

                        if ($(this).attr('id') == 'itemsCount') {
                            orderSummary.totalItems = $(this).text().trim();
                        } else if ($(this).attr('id') == 'orderTotal') {
                            orderSummary.totalAmount = $(this).text().trim();
                        }
                    });
                    jsonArray.push(jsonArrayTd);
                });

                var customerInfo = {
                    name: $( "#name" ).val().trim(),
                    mobile: $( "#cellNumber" ).val().trim(),
                    email: $( "#email" ).val().trim()
                }

                return {header: jsonHeaderArray[0], data: jsonArray, summary: orderSummary, customer: customerInfo};
            }


            /**
             * Convierte la tabla enviada a csv o texto
             * @param table
             * @returns {string}
             */
            function toCsv(table){
                var output = "";

                var rows = table.find('tr').not(options.ignoreRows);
                var numCols = rows.first().find("td,th").not(options.ignoreColumns).length;

                rows.each(function() {
                    $(this).find("td,th").not(options.ignoreColumns)
                        .each(function(i, col) {
                            var column = $(col);

                            // Strip whitespaces
                            var content = options.trimContent ? $.trim(column.text()) : column.text();

                            output += options.quoteFields ? quote(content) : content;
                            if(i !== numCols-1) {
                                output += options.separator;
                            } else {
                                output += options.newline;
                            }
                        });
                });

                return output;
            }

            function isOrderFormValid() {
                var hasAnyItem = false;
                $( ".qty_id" ).each(function( index ) {
                  if ($( this ).val() != '' && $( this ).val() > 0) {
                    hasAnyItem = true;
                    return;
                  }
                });

                if (!hasAnyItem) {
                    alert('You must order atleast one product');
                    return hasAnyItem;
                }

                var isValid = true;
                if ($( "#name" ).val().trim() == '') {
                    $( "#name" ).addClass("error");
                    isValid = false;
                } else {
                    $( "#name" ).removeClass("error");
                }

                var cellNo = $( "#cellNumber" ).val().trim();                
                if (cellNo == '') {
                    $( "#cellNumber" ).addClass("error");
                    isValid = false;
                } else if(!cellNo.match(/^\d{10}$/)) {
                    $( "#cellNumber" ).addClass("error");
                    alert("Please enter valid mobile number");
                    isValid = false;
                } else {
                    $( "#cellNumber" ).removeClass("error");
                }

                var email = $("#email").val().trim();
                if (email != '' && !(/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(email))) {
                    $("#email").addClass("error");
                    alert("Please enter valid email address");
                    isValid = false;
                    return;
                } else {
                    $("#email").removeClass("error");
                }

                if (!isValid) {
                    alert('You must enter your contact details');
                }

                return hasAnyItem && isValid;
            }

            function submitOrder(orderSummary, pdfDoc, type) {
                $(".loader").show(); 
                $("#preloder").show();
                const getOrderIdParams = {
                    action: 'newid',
                    entity: 'orders'
                }
                const submitOrderParams = {
                    action: 'create',
                    entity: 'orders'
                }
                const q = new URLSearchParams(submitOrderParams);
                const orderRequest = {
                    totalItems: orderSummary.summary.totalItems,
                    totalAmount: orderSummary.summary.totalAmount,
                    type: type? "quote" : "order",
                    details: JSON.stringify(orderSummary.data),
                    customer: orderSummary.customer
                };

                var notificationParams = {
                  order_number: '', 
                  name: orderSummary.customer.name,
                  mobile:orderSummary.customer.mobile,
                  email: orderSummary.customer.email,
                  isQuote: type,
                  data: ''
                };

                fetch(orderServiceUrl + "?" + (new URLSearchParams(getOrderIdParams)))
                .then(res => res.json())
                .then(res => {
                    orderRequest.id = res.id;
                    fetch(orderServiceUrl + "?" + q, {
                      redirect: "follow",
                      method: "POST",
                      body: JSON.stringify(orderRequest),
                      mode: 'no-cors',
                      headers: {
                        "Content-Type": "text/plain;charset=utf-8",
                      },
                    })
                    .then(res => {
                        orderNumber = orderRequest.id;                    
                        pdfDoc.text("" + orderNumber, 390, 135); // set order number in the PDF
                        notificationParams.order_number = orderNumber;
                        notificationParams.data = doc.output("datauristring");

                        fetch(orderConfUrl, {
                          redirect: "follow",
                          method: "POST",
                          body: JSON.stringify(notificationParams),
                          mode: 'no-cors',
                          headers: {
                            "Content-Type": "application/json",
                          },
                        })
                        .then(res => {
                            if(!isQuote) {
                                alert("Your order " + orderNumber + " has been submitted successfully and your copy will be downloaded.");
                            }

                            pdfDoc.save("s2kpyrotech_order_" + orderNumber +".pdf");
                            $(".loader").fadeOut(); 
                            $("#preloder").delay(400).fadeOut("slow");
                        }).catch(function(err) {
                            alert("We received your order " + orderNumber + " and you will receive a confirmation later.");
                            $(".loader").fadeOut(); 
                            $("#preloder").delay(400).fadeOut("slow");
                        });
                    })
                    .catch(function(err) {
                        alert("Sorry we are unable to process your order currently. Please try again later.");
                        $(".loader").fadeOut(); 
                        $("#preloder").delay(400).fadeOut("slow");
                    });
                });
            }

            var el = this;
            var dataMe;
            if(options.type == 'csv' || options.type == 'txt'){
                var table = this.filter('table'); // TODO use $.each

                if(table.length <= 0){
                    throw new Error('tableHTMLExport must be called on a <table> element')
                }

                if(table.length > 1){
                    throw new Error('converting multiple table elements at once is not supported yet')
                }

                dataMe = toCsv(table);

                if(defaults.consoleLog){
                    console.log(dataMe);
                }

                download(options.filename,dataMe);

                //var base64data = "base64," + $.base64.encode(tdData);
                //window.open('data:application/'+defaults.type+';filename=exportData;' + base64data);
            }else if(options.type == 'json'){

                var jsonExportArray = toJson(el);

                if(defaults.consoleLog){
                    console.log(JSON.stringify(jsonExportArray));
                }
                dataMe = JSON.stringify(jsonExportArray);

                download(options.filename,dataMe)
                /*
                var base64data = "base64," + $.base64.encode(JSON.stringify(jsonExportArray));
                window.open('data:application/json;filename=exportData;' + base64data);*/
            } else if(options.type == 'pdf' || options.type == 'submit') {
                var isQuote = (options.type == 'pdf');
                if (!isOrderFormValid()) {
                    return;
                }

                if (orderNumber != '') {
                    if (prevOrderType == 'order' && !isQuote) {
                        if (!confirm('You have an existing ' + (isQuote? 'quote' : 'order') +'. Do you want to update it?')) {
                             // orderNumber = Date.now();
                        }
                    }
                } else {
                    // orderNumber = Date.now();
                }

                prevOrderType = (options.type == 'pdf')? "quote" : "order";

                var jsonExportArray = toJson(el);
                var productsTopMarginAdjustment = 0;
                var doc = new jsPDF('p', 'pt');
                doc.addImage(banner, 'jpeg', 10, 10, 575, 100 );
                doc.setFont("arial")
                  .setFontSize(13)
                  .setFontStyle("normal");
                doc.text("Name                 : " + jsonExportArray.customer.name, 15, 135);
                doc.text("Mobile Number : " + jsonExportArray.customer.mobile, 15, 150);
                if (jsonExportArray.customer.email != '') {
                    doc.text("Email Address   : " + jsonExportArray.customer.email, 15, 165);
                    productsTopMarginAdjustment = 15;
                }

                var type = (isQuote)? "Quote" : "Order";
                doc.text(type + " Number : ", 300, 135);
                doc.setFontType("bold");
                doc.text("", 390, 135);
                doc.setFontType("normal");
                doc.text(type + " Date     : ", 300, 150);
                doc.setFontType("bold");
                doc.text(new Date().toLocaleString(), 390, 150);

                doc.autoTable(jsonExportArray.header, jsonExportArray.data, 
                    {startX: 10, startY: 165 + productsTopMarginAdjustment,
                        columnStyles: {0:{halign: 'right'},
                                       6:{halign: 'right'},
                                       7:{halign: 'right'},
                                       8:{halign: 'right'}} });
                
                submitOrder(jsonExportArray, doc, isQuote);
            }
            return this;
        }
    });
})(jQuery);

